import { StyleSheet } from "aphrodite";
const styles = StyleSheet.create({
    text4_wrapper:{
        marginTop: "60px"
    },
    text4_h:{
        fontFamily: "SFUIDisplay-Bold",
        fontSize: '20px',
        fontWeight: 700,
        marginBottom: '40px'
    },
    text4_ul:{
        listStyle: "none",
        padding: 0,
        margin: 0,
        marginBottom: "60px",
        color: "#acacac",
        lineHeight: '40px',
        fontFamily: "SFUIDisplay-Light",
        fontSize: '20px'
    },
    text4_a_h:{
        fontFamily: 'SFUIDisplay-Semibold',
        fontWeight: 600,
        fontSize: '20px',
        marginBottom: "20px"
    },
    text4_a_t_w:{
        marginBottom: "40px"
    },
    text4_a_t:{
        fontFamily: "SFUIDisplay-Light",
        fontSize: "20px",
        color: "#acacac",
        lineHeight: '27px'
    }
});
export default styles;
